// SPDX-License-Identifier: MIT
pragma solidity 0.8.10;

contract KETSBlockchain {
    address public regulator;  // Ministry of Environment / K-ETS authority

    uint public auctionPrice = 29 ether; // Auction price in ETH (KRW 10,672)
    uint public creditPrice = 0.0027 ether;  // Price per carbon credit (KRW 9,999)

    constructor() {
        regulator = msg.sender; // Set the contract deployer as the regulator
    }

    //  Events for logging
    event IndustryRegistered(address indexed industry, string name);
    event VerifierRegistered(address indexed verifier, string name);
    event OffsetProjectRegistered(address indexed owner, string projectName);
    event CreditsIssued(address indexed industry, uint amount, string method);
    event CreditTraded(address indexed from, address indexed to, uint amount);
    event CreditAuctioned(address indexed bidder, uint amount);
    
    //  Modifier to restrict actions to the regulator
    modifier onlyRegulator() {
        require(msg.sender == regulator, "Not authorized");
        _;
    }

    struct Industry {
        string name;
        address industryAddress;
        uint emissions;
        uint creditsOwned;
        string creditType; // free allowances / auctioning / trading / offsetProject
        bool isRegistered;
        bool isEITE;
    }

    struct OffsetProject {
        string projectName;
        address owner;
        uint creditsEarned;
        uint incentive;
        bool isApproved;
    }

    struct Auction {
        uint creditsAvailable;
        uint minBidPrice;
        bool isActive;
        mapping(address => uint) bids;
    }

    struct Verifier {
        string verifierName;
        address verifierAddress;
        bool isApproved;
    }

    struct Stakeholder {
        string name;
        address stakeholderAddress;
    }    

    struct GHG {
        uint CO2; 
        uint CH4;
        uint N2O;
        uint HFCs;
        uint PFCs; 
        uint SF6;
    }

    mapping(address => Industry) public industries;
    mapping(address => OffsetProject) public offsetProjects;
    mapping(address => Verifier) public verifiers;
    mapping(address => Stakeholder) public stakeholders;
    mapping(address => GHG) public ghgEmissions;
    Auction public currentAuction;

    //  Register an industry
    function registerIndustry(string memory _name, bool _isEITE) public {
        require(!industries[msg.sender].isRegistered, "Already registered");
        industries[msg.sender] = Industry(_name, msg.sender, 0, 0, "", true, _isEITE);
        emit IndustryRegistered(msg.sender, _name);
    }

    //  Register an offset project
    function registerOffsetProject(string memory _projectName) public {
        offsetProjects[msg.sender] = OffsetProject(_projectName, msg.sender, 0, 0, false);
        emit OffsetProjectRegistered(msg.sender, _projectName);
    }

    //  Register a verifier
    function registerVerifier(string memory _verifierName) public onlyRegulator {
        verifiers[msg.sender] = Verifier(_verifierName, msg.sender, true);
        emit VerifierRegistered(msg.sender, _verifierName);
    }

    //  Update GHG emissions for an industry
    function updateGHGEmissions(address _industry, uint _CO2, uint _CH4, uint _N2O, uint _HFCs, uint _PFCs, uint _SF6) external {
        require(industries[_industry].isRegistered, "Industry not registered");
        ghgEmissions[_industry] = GHG(_CO2, _CH4, _N2O, _HFCs, _PFCs, _SF6);
    }

    //  View emissions
    function viewEmissionUpdate(address _industry) external view returns (GHG memory) {
        return ghgEmissions[_industry];
    }

    //  Issue free allocation of credits (100% EITE, 90% others)
    function freeAllocation(address _industryAddress, uint _credits) external onlyRegulator {
        require(industries[_industryAddress].isRegistered, "Industry not registered");
        uint allocatedCredits = industries[_industryAddress].isEITE ? _credits : (_credits * 90) / 100;
        industries[_industryAddress].creditsOwned += allocatedCredits;
        emit CreditsIssued(_industryAddress, allocatedCredits, "Free Allocation");
    }

    //  Start an auction
    function createAuction(uint _creditsAvailable, uint _minBidPrice) external onlyRegulator {
        require(!currentAuction.isActive, "Auction already active");
        require(_creditsAvailable > 0, "Credits must be greater than zero");

        currentAuction.creditsAvailable = _creditsAvailable;
        currentAuction.minBidPrice = _minBidPrice;
        currentAuction.isActive = true;
    }

    //  Place a bid in the auction
    function placeBid(uint _bidAmount) external {
        require(currentAuction.isActive, "No active auction");
        require(_bidAmount >= currentAuction.minBidPrice, "Bid too low");
        require(industries[msg.sender].creditsOwned >= _bidAmount, "Insufficient credits");
        require(_bidAmount <= (currentAuction.creditsAvailable * 15) / 100, "Cannot bid more than 15%");

        currentAuction.bids[msg.sender] = _bidAmount;
        emit CreditAuctioned(msg.sender, _bidAmount);
    }

    //  Trade carbon credits
    function tradeCredits(address _to, uint _amount) external {
        require(industries[msg.sender].creditsOwned >= _amount, "Insufficient credits");
        industries[msg.sender].creditsOwned -= _amount;
        industries[_to].creditsOwned += _amount;
        emit CreditTraded(msg.sender, _to, _amount);
    }

    //  Borrow credits (compliance borrowing)
    function borrowCredits(address _to, uint _amount) external {
        require(_amount > 0 && industries[msg.sender].creditsOwned > _amount, "Invalid borrow amount");
        industries[_to].creditsOwned += _amount;
        industries[msg.sender].creditsOwned -= _amount;
    }

    //  View borrowed credits
    function viewBorrowedCredits(address _industry) external view returns (uint) {
        return industries[_industry].creditsOwned;
    }
}
